import React from "react";
import {
  FooterBlock,
  FooterContent,
  FooterLink,
  FooterListWrapper,
  NameLi,
  Li,
  FooterIcon
} from "./FooterFragments";

const InnnerLi = ({ item }) =>
  item.links.map((link, index) => (
    <Li key={index}>
      {props.icon ? (
        <FooterLink href={link.href}>{link.name}</FooterLink>
      ) : (
        <FooterIcon
          country={item.country}
          inactive={link.inactive}
          href={link.href}
          url={link.url}
        />
      )}
    </Li>
  ));
const FooterLinkComponent = props => {
  return props.links.map((item, index) => (
    <FooterListWrapper key={index}>
      <ul className="text-left align-top">
        <NameLi> {item.name} </NameLi>
        {props.lowerFooter
          ? item.lowerFooter && <InnnerLi item={item} />
          : !item.lowerFooter && <InnnerLi item={item} />}
      </ul>
    </FooterListWrapper>
  ));
};

const FooterComponent = props => (
  <FooterBlock>
    <FooterContent>
      <FooterLinkComponent
        links={FooterLinks}
        lowerFooter={props.lowerFooter}
        icon={false}
      />
      <FooterLinkComponent
        links={Icons}
        lowerFooter={props.lowerFooter}
        icon={true}
      />
    </FooterContent>
  </FooterBlock>
);

export default FooterComponent;
